import { useNavigate } from "react-router-dom";
import { useState } from "react";
import "../register.css";

const RegisterPage = () => {
  const navigate = useNavigate();

  function Header() {
    return (
      <header>
        <h2>AeroParker</h2>
      </header>
    );
  }

  function SubmitForm() {
    const [formData, setFormData] = useState({
      email: "",
      title: "",
      firstName: "",
      lastName: "",
      addressLine1: "",
      addressLine2: "",
      city: "",
      postcode: "",
      phoneNumber: "",
    });

    const [formErrors, setFormErrors] = useState({
      email: "",
      title: "",
      firstName: "",
      lastName: "",
      addressLine1: "",
      addressLine2: "",
      city: "",
      postcode: "",
      phoneNumber: "",
    });

    const handleChange = (e) => {
      const { name, value } = e.target;
      setFormData((prevData) => ({ ...prevData, [name]: value }));
      setFormErrors((prevErrors) => ({ ...prevErrors, [name]: "" }));
    };

    let handleSubmit = async (e) => {
      e.preventDefault();

      let errors = {};
      if (!formData.email.trim()) {
        errors.email = "Email field is required";
      }
      if (!formData.title.trim()) {
        errors.title = "Title field is required";
      }
      if (!formData.firstName.trim()) {
        errors.firstName = "First name is required";
      }
      if (!formData.lastName.trim()) {
        errors.lastName = "Last name is required";
      }
      if (!formData.addressLine1.trim()) {
        errors.addressLine1 = "Address Line 1 is required";
      }
      if (!formData.postcode.trim()) {
        errors.postcode = "Postcode is required";
      }
      if (Object.keys(errors).length > 0) {
        setFormErrors(errors);
      }

      try {
        await fetch("https://localhost:7166/Login", {
          method: "POST",
          headers: {
            "content-type": "application/json",
          },
          body: JSON.stringify({
            email: formData.email,
            title: formData.title,
            firstName: formData.firstName,
            lastName: formData.lastName,
            addressLine1: formData.addressLine1,
            addressLine2: formData.addressLine2,
            city: formData.city,
            postcode: formData.postcode,
            phoneNumber: formData.phoneNumber,
          }),
        })
          .then((response) => {
            if (response.status === 201) {
                navigate("/success")
            }
          })
          .then((data) => {
            console.log(data);
            navigate("/Home");
          });
      } catch (err) {
        console.log(err);
      }
    };

    return (
      <form onSubmit={(e) => handleSubmit(e)}>
        <div className="form-group">
          <label>Email</label>
          <input
            className="inputText"
            id="Email"
            type="email"
            placeholder="Email"
            value={formData.email}
            onChange={handleChange}
          />
          {formErrors.email && (
            <span className="error">{formErrors.email}</span>
          )}
        </div>

        <div className="form-group">
          <label>Title</label>
          <input
            className="inputText"
            id="Title"
            type="text"
            placeholder="Choose Mr, Mrs, Miss, ms, Dr or Sir"
            value={formData.title}
            onChange={handleChange}
          />
          {formErrors.title && (
            <span className="error">{formErrors.title}</span>
          )}
        </div>

        <div className="form-group">
          <label>First name</label>
          <input
            className="inputText"
            id="FirstName"
            type="text"
            placeholder="First name"
            value={formData.firstName}
            onChange={handleChange}
          />
          {formErrors.firstName && (
            <span className="error">{formErrors.firstName}</span>
          )}
        </div>

        <div className="form-group">
          <label>First name</label>
          <input
            className="inputText"
            id="LastName"
            type="text"
            placeholder="Last name"
            value={formData.lastName}
            onChange={handleChange}
          />
          {formErrors.lastName && (
            <span className="error">{formErrors.lastName}</span>
          )}
        </div>

        <div className="form-group">
          <label>Address Line 1</label>
          <input
            className="inputText"
            id="AddressLine1"
            type="text"
            placeholder="Address line 1"
            value={formData.addressLine1}
            onChange={handleChange}
          />
          {formErrors.addressLine1 && (
            <span className="error">{formErrors.addressLine1}</span>
          )}
        </div>

        <div className="form-group">
          <label>Address Line 2</label>
          <input
            className="inputText"
            id="AddressLine2"
            type="text"
            placeholder="Address line 2 (optional)"
            value={formData.addressLine2}
            onChange={handleChange}
          />
          {formErrors.addressLine2 && (
            <span className="error">{formErrors.addressLine2}</span>
          )}
        </div>

        <div className="form-group">
          <label>City</label>
          <input
            className="inputText"
            id="City"
            type="text"
            placeholder="City (optional)"
            value={formData.city}
            onChange={handleChange}
          />
          {formErrors.city && <span className="error">{formErrors.city}</span>}
        </div>

        <div className="form-group">
          <label>Postcode</label>
          <input
            className="inputText"
            id="Postcode"
            type="text"
            placeholder="Postcode"
            value={formData.postcode}
            onChange={handleChange}
          />
          {formErrors.postcode && (
            <span className="error">{formErrors.postcode}</span>
          )}
        </div>

        <div className="form-group">
          <label>Phone number</label>
          <input
            className="inputText"
            id="AddressLine1"
            type="text"
            placeholder="Phone number"
            value={formData.phoneNumber}
            onChange={handleChange}
          />
          {formErrors.phoneNumber && (
            <span className="error">{formErrors.phoneNumber}</span>
          )}
        </div>

        <div id="onSuccess"></div>

        <input
          className="inputLogin"
          type="submit"
          value={"Register"}
          onClick={() => {
            document.getElementById("onSuccess").innerHTML = "Loading...";
          }}
        />
      </form>
    );
  }

  return (
    <div>
      <Header />
      <SubmitForm />
    </div>
  );
};

export default RegisterPage;
